import React from "react";

const List = (props) => {
  const itenararyHeaders = ["Note Title", "Action"];
  return (
    <ul>
      {props.itenraries.length > 0 ? (
        props.itenraries.map((invoice) => (
          <li key={invoice.id}>
            <a href="#">
              <h2>{invoice.item}</h2>
              <p>{invoice.han}</p>

              <button
                className="btn btn-info mt-2"
                onClick={() => props.editinvoice(invoice)}
              >
                {" "}
                Edit
              </button>

              <button>Edit</button>
              <button onClick={() => props.deleteinvoice(invoice.id)}>
                Delete
              </button>
            </a>
          </li>
        ))
      ) : (
        <tr>
          <td colSpan="3">Add a note</td>
        </tr>
      )}
    </ul>
  );
};

export default List;
